import React from "react";

import "/App.css";

function App() {
  return (
    <nav id="navbar">
      <ul>
        <li>
          <a href="#">home</a>
        </li>
        <li>
          <a href="#">about</a>
        </li>
        <h3 class="logo">logo</h3>
        <li>
          <a href="#">services</a>
        </li>
        <li>
          <a href="#">contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default App;
